	static void byDfs(int r, int c) {
		visited[r][c] = true;

		for (int d = 0; d < deltas.length; d++) {
			int nr = r + deltas[d][0];
			int nc = c + deltas[d][1];
			if (map[nr][nc] == 0 & !visited[nr][nc]) {
				byDfs(nr, nc);
			} else if (map[nr][nc] == 3) {
				Answer = 1;
				return;
			}
		}
	}

	// BFS는 최단 경로를 뽑을 때 주로 사용
	static void byBfs(int sr, int sc) {
		// 출발점을 넣는다.
		Queue<Point> q = new LinkedList<>();
		q.offer(new Point(sr, sc));
		visited[sr][sc] = true;
		int step = 0;
		while (!q.isEmpty()) {
			// 현재 queue에 있는 녀석의 크기를 살펴본 후 거기까기만 반복 돌기
			int size = q.size();
			while (size-- > 0) {
				// 맨 앞에 가져온다.
				Point head = q.poll();
				// 사용하기.
				// 자식 탐색
				for (int d = 0; d < 4; d++) {
					int nr = head.r + deltas[d][0];
					int nc = head.c + deltas[d][1];
					// 좌표가 신뢰할 수 있는가? 범위 내부인가?
					// 갈 수 있고 미방문인가?
					if (map[nr][nc] == 0 & !visited[nr][nc]) {
						visited[nr][nc] = true;
						q.offer(new Point(nr, nc));
					} else if (map[nr][nc] == 3) {
						Answer = 1;
						break;
					}

				}
			} // 하나의 step 탐색 완료
			step++;
		}
		// System.out.println("최종 step: "+step);
	}

